package net.yozo.services.front.sms.bean;import net.yozo.core.dao.page.PagerModel;import java.io.Serializable;import java.sql.Timestamp;public class Sms extends PagerModel implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String phone;	private String content;	private Timestamp sendTime;	private String type;	private String returnCode;	private String sendStatus;	private Integer sendCount;	public void clear() {		super.clear();		id = null;		phone = null;		content = null;		sendTime = null;		type = null;		returnCode = null;		sendStatus = null;		sendCount=0;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getPhone() {		return phone;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getContent() {		return content;	}	public void setContent(String content) {		this.content = content;	}	public Timestamp getSendTime() {		return sendTime;	}	public void setSendTime(Timestamp sendTime) {		this.sendTime = sendTime;	}	public String getType() {		return type;	}	public void setType(String type) {		this.type = type;	}	public String getReturnCode() {		return returnCode;	}	public void setReturnCode(String returnCode) {		this.returnCode = returnCode;	}	public String getSendStatus() {		return sendStatus;	}	public void setSendStatus(String sendStatus) {		this.sendStatus = sendStatus;	}	public Integer getSendCount() {		return sendCount;	}	public void setSendCount(Integer sendCount) {		this.sendCount = sendCount;	}	@Override	public String toString() {		return "Sms{" +				"id='" + id + '\'' +				", phone='" + phone + '\'' +				", content='" + content + '\'' +				", sendTime=" + sendTime +				", type='" + type + '\'' +				", returnCode='" + returnCode + '\'' +				", sendStatus='" + sendStatus + '\'' +				", sendCount=" + sendCount +				'}';	}}